import './Expenses.css';
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {

    return (
        <div className='expenses'>
            {
                props.things.map(({title, amount, date}) => {
                    return <ExpenseItem title={title} amount={amount} date={date}/>
                })
            }
        </div>

    );
}

export default Expenses;
